import Head from 'next/head';
import Menu from '../components/Menu';
import { Jumbotron, Container } from 'reactstrap';
import 'bootstrap/dist/css/bootstrap.css';

function HomePage() {
  return (
    <div>
      <Head>
        <title>Projeto Integrador</title>
        <meta name="description" content="projeto Integrador Univesp" />
        <meta name="author" content="Marcos Orioli" />
      </Head>
      <Menu />
      <br />
      <Jumbotron fluid className="servicos">
        <style>{`.servicos{
            padding-top: 20px;
            padding-bottom: 20px;
            background-color: #0000
            
          }
          `}</style>
        <Container className="text-center">
          <h1 className="display-4"> Dados Diários</h1>
          <p className="lead">Gerenciamento Diário</p>
        </Container>
      </Jumbotron>
    </div>
  );
}
export default HomePage;
